import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import { Provider } from 'react-redux';
import tmpDataStore from './stores/tmpDataStore';

ReactDOM.render(
  <Provider store={tmpDataStore}>
    <App />
  </Provider>,
  document.getElementById('root')
);
